class Solution:
    def closeStrings(self, word1: str, word2: str) -> bool:

        size1 = len(word1)
        size2 = len(word2)

        if size1 != size2:
            return False

        w1s = 0
        w2s = 0
        w1 = [0 for _ in range(26)]
        w2 = [0 for _ in range(26)]

        for i in range(size1):

            widx1 = ord(word1[i]) - ord("a")
            widx2 = ord(word2[i]) - ord("a")
            w1[widx1] += 1
            w2[widx2] += 1
            w1s = w1s | 1 << (widx1)
            w2s = w2s | 1 << (widx2)

        if w1s != w2s:
            return False

        if sorted(w1) == sorted(w2):
            return True

        return False


